  /* find indexes */

  i1 = (int)((rho16 - (min_rho16))/d1);
  if (i1<0)       i1 = 0;
  else if (N1<i1) i1 = N1;

  j1 = (int)((R13 - (min_R13))/d2);
  if (j1<0)       j1 = 0;
  else if (N2<j1) j1 = N2;

